import React from 'react';
import { Box, Typography, Grid, Paper, Chip, Avatar } from '@mui/material';
import { styled } from '@mui/material/styles';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ChatBubbleOutlineIcon from '@mui/icons-material/ChatBubbleOutline';

const Card = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
  cursor: 'pointer',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: theme.shadows[8],
  },
}));

const CardTag = styled(Chip)(({ tagcolor }) => ({
  backgroundColor: tagcolor,
  color: '#fff',
  marginBottom: '12px',
}));

const HotPosts = () => {
  const posts = [
    {
      tag: '컬러 매칭',
      tagColor: '#FF6B6B',
      title: '봄 시즌 컬러 조합 추천',
      content: '봄을 맞이하여 파스텔톤 위주의 컬러 매칭을 추천드립니다. 특히 연한 핑크와 민트의 조합이...',
      author: '컬러마스터',
      likes: 128,
      comments: 32,
    },
    {
      tag: '스타일 팁',
      tagColor: '#4ECDC4',
      title: '색각이상 친화적인 정장 스타일링',
      content: '무채색을 기본으로 하되, 포인트 컬러를 활용하는 방법을 소개합니다...',
      author: '패션어드바이저',
      likes: 95,
      comments: 28,
    },
    {
      tag: '경험공유',
      tagColor: '#45B7D1',
      title: '제 패션 여정을 공유합니다',
      content: '색각이상을 가지고 있지만, 패션을 즐기는 방법을 찾았습니다...',
      author: '컬러풀라이프',
      likes: 156,
      comments: 45,
    },
  ];

  return (
    <Box sx={{ py: 4 }}>
      <Typography variant="h4" component="h2" gutterBottom align="center" sx={{ mb: 6 }}>
        인기 게시물
      </Typography>
      <Grid container spacing={4}>
        {posts.map((post, index) => (
          <Grid item xs={12} md={4} key={index}>
            <Card elevation={3}>
              <CardTag label={post.tag} tagcolor={post.tagColor} />
              <Typography variant="h6" gutterBottom>
                {post.title}
              </Typography>
              <Typography variant="body2" color="text.secondary" sx={{ mb: 2, flexGrow: 1 }}>
                {post.content}
              </Typography>
              <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  <Avatar sx={{ width: 24, height: 24, mr: 1 }} />
                  <Typography variant="body2" color="text.secondary">
                    {post.author}
                  </Typography>
                </Box>
                <Box sx={{ display: 'flex', gap: 2 }}>
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
                    <FavoriteIcon color="error" sx={{ fontSize: '0.9rem' }} />
                    <Typography variant="body2" color="text.secondary">
                      {post.likes}
                    </Typography>
                  </Box>
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
                    <ChatBubbleOutlineIcon sx={{ fontSize: '0.9rem' }} />
                    <Typography variant="body2" color="text.secondary">
                      {post.comments}
                    </Typography>
                  </Box>
                </Box>
              </Box>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default HotPosts;
